"    Expert consensus on the management of immunosuppression for specific skin cancer scenarios",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"2\" rowspan=\"2\">",
"        Skin cancer scenario*",
"       </td>",
