"       <td class=\"subtitle2\">",
"        Kidney allograft",
"       </td>",
"       <td class=\"subtitle2\">",
"        Heart allograft",
"       </td>",
"       <td class=\"subtitle2\">",
"        Liver allograft",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1.",
"       </td>",
"       <td>",
"        No history of actinic keratosis or skin cancer",
"       </td>",
