"        2.",
"       </td>",
"       <td>",
"        <p>",
"         History of actinic keratosis",
"        </p>",
"        <ul>",
"         <li>",
"          No risk of mortality",
"         </li>",
"         <li>",
"          Marker for increased skin cancer risk in future",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
