"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3.",
"       </td>",
"       <td>",
"        <p>",
"         History of &le;1 NMSC per year",
"        </p>",
"        <ul>",
"         <li>",
"          Negligible risk of mortality, &le;1 minor surgical procedure per year",
"         </li>",
"         <li>",
"          Patients handle this with ease",
"         </li>",
"         <li>",
"          Warning sign of possible future skin cancers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Mild",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        Mild",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4.",
"       </td>",
"       <td>",
"        <p>",
"         History of 2-5 NMSCs per year",
"        </p>",
"        <ul>",
"         <li>",
"          0-5 percent risk of mortality over 3 years, minor-moderate surgical procedure 2-5 times per year",
"         </li>",
"         <li>",
"          Patients can usually handle this, but it starts to bother them",
"         </li>",
"         <li>",
"          Likelihood of numerous future skin cancers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
