"       <td>",
"        <p>",
"         History of 6-10 NMSCs per year",
"        </p>",
"        <ul>",
"         <li>",
"          1 percent risk of mortality over 3 years, minor-moderate surgical procedure 6-10 times per year",
"         </li>",
"         <li>",
"          Patients can usually handle this, but it bothers them",
"         </li>",
"         <li>",
"          High likelihood of numerous future skin cancers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
