"        6.",
"       </td>",
"       <td>",
"        <p>",
"         History of 11-25 NMSCs per year",
"        </p>",
"        <ul>",
"         <li>",
"          2 percent risk of mortality over 3 years, minor-moderate surgical procedure 11-25 times per year",
"         </li>",
"         <li>",
"          This level of morbidity causes moderate distress and moderate disfigurement, depression may begin",
"         </li>",
"         <li>",
"          High likelihood of severe future skin cancers",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Mild",
